window.bookSummaryJSON = "<p><b>Welcome children of Earth, do not be afraid.</b></p> <p>After a devastating car crash leaves her addicted to pain pills and her best friend dead, Meredith Gale has finally been pushed beyond her breaking point. Now, ending her life seems like the only way out, and that choice has left her dangling by her fingertips from a bridge high above the freezing water of the San Francisco Bay. But someone, or something, has other plans for Meredith. As her fingers slip from the cold steel of the bridge, a disembodied voice asks her a simple question: “Candidate 13: Do you wish to be saved?”&nbsp;</p> <p>Realizing her mistake too late, Meredith screams “Yes!” and instantly finds herself transported to a mysterious island, alongside hundreds of other Candidates like her, each pulled from human history with seemingly little in common. But when Meredith stumbles across a cryptic message meant only for her, she uncovers an even bigger mystery - a mystery that places the fate of humanity’s future firmly in her hands.</p> <p>With the help of her new companions, Meredith sets out on an impossible journey to find the one person who can solve the riddle of why they were brought to this strange, alien Earth...assuming they can survive the dangers that lurk within this new world and the dark forces massing against them.</p> <p><b>Check out the first audiobook in the This Alien Earth Series, a futuristic adventure perfect for fans of Jeremy Robinson, Stephen King, and </b><b><i>Lost</i></b><b>. </b></p>"; 
